import numpy as np

class Solution:
    def longestCommonSubsequence(self, a, b) :
        if (len(a) < len(b)):
            return self.longestCommonSubsequence(b, a)
        print(len(a))
        print(len(b))
        m = np.zeros((2, len(b) + 1), dtype=np.int16)
        for i in range(1, len(a)+1):
            for j in range(1, len(b)+1):
                if (a[i - 1] == b[j - 1]): m[i % 2][j] = m[(i -1) % 2][j - 1] + 1
                else: m[i % 2][j] = max(m[(i - 1) % 2][j], m[i % 2][j - 1])

        print(m)
        print(m.shape)
        return m[len(a) % 2, len(b)]
        

s = Solution()
a = ""
b = ""
print(s.longestCommonSubsequence(a, b))

